webpackJsonp([0xd0f77eab6071],{585:function(t,e){t.exports={data:{wordpressPost:{title:"Cigarette packaging, twitter and workplace bullying: Most read articles in July",content:'<p>The most-read article in July was Wakefield <em>et al</em>&#8216;s article on effects of the Australian plain cigarette packaging policy on adult smokers, which received widespread <a href="http://www.thesundaytimes.co.uk/sto/news/Politics/article1290565.ece?CMP=OTH-gnws-standard-2013_07_21" target="_blank">press coverage</a>. Another popular title was Brynolf <em>et al</em>&#8216;s paper on physician&#8217;s use of Twitter.  Other newly-published papers in the top ten include Wallace <em>et al</em>&#8216;s systematic review on the epidemiology of malpractice claims in primary care as well as Carter <em>et al</em>&#8216;s interview study of workplace bullying in the NHS.</p>\n<table width="483" border="1" cellspacing="0" cellpadding="0">\n<tbody>\n<tr>\n<td valign="top" width="50">Rank</td>\n<td valign="top" width="132">Author(s)</td>\n<td valign="top" width="301">Title</td>\n</tr>\n<tr>\n<td width="50">1</td>\n<td width="132">Wakefield <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/cgi/content/full/3/7/e003175" target="_blank">Introduction effects of the Australian plain packaging policy on adult smokers: a cross-sectional stud</a></td>\n</tr>\n<tr>\n<td width="50">2</td>\n<td width="132">Carpenter <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/cgi/content/full/3/5/e002299" target="_blank">Bed sharing when parents do not smoke: is there a risk of SIDS? An individual level analysis of five major case–control studies</a></td>\n</tr>\n<tr>\n<td width="50">3</td>\n<td width="132">Brynolf <em>et al</em></td>\n<td valign="top" width="301"><a href="bmjopen.bmj.com/cgi/content/full/3/7/e002988" target="_blank">Virtual colleagues, virtually colleagues—physicians’ use of Twitter: a population-based observational study</a></td>\n</tr>\n<tr>\n<td width="50">4</td>\n<td width="132">Wallace <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/cgi/content/full/3/7/e002929" target="_blank">The epidemiology of malpractice claims in primary care: a systematic review</a></td>\n</tr>\n<tr>\n<td width="50">5</td>\n<td width="132">Gao<em> et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/cgi/content/full/3/7/e002881" target="_blank">Effects of centrally acting ACE inhibitors on the rate of cognitive decline in dementia</a></td>\n</tr>\n<tr>\n<td width="50">6</td>\n<td width="132">Doyle<em> et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/cgi/content/full/3/1/e001570" target="_blank">A systematic review of evidence on the links between patient experience and clinical safety and effectiveness</a></td>\n</tr>\n<tr>\n<td width="50">7</td>\n<td width="132">Ford <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/cgi/content/full/3/3/e002269">Current treatments in diabetic macular oedema: systematic review and meta-analysis</a></td>\n</tr>\n<tr>\n<td width="50">8</td>\n<td width="132">Pearce <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/cgi/content/full/3/7/e003152" target="_blank">Obesity in young men, and individual and combined risks of type 2 diabetes, cardiovascular morbidity and death before 55 years of age: a Danish 33-year follow-up study</a></td>\n</tr>\n<tr>\n<td width="50">9</td>\n<td width="132">Heneghan <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/cgi/content/full/3/7/e003298" target="_blank">Evidence for non-communicable diseases: analysis of Cochrane reviews and randomised trials by World Bank classification</a></td>\n</tr>\n<tr>\n<td width="50">10</td>\n<td width="132">Carter <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/cgi/content/full/3/6/e002628" target="_blank">Workplace bullying in the UK NHS: a questionnaire and interview study on prevalence, impact and barriers to reporting</a></td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p>Most read figures are based on pdf downloads and full text views. Abstract views are excluded.<!--TrendMD v2.4.3--></p>\n'},site:{siteMetadata:{title:"Gatsby Default Starter"}}},pathContext:{id:"905acb2f-4e50-5aa7-bcb7-ea639b68e067"}}}});
